/**
 * Provides Canada Post functions
 */

var Logger = require('dw/system/Logger');
var Resource = require('dw/web/Resource');
var Site = require('dw/system/Site');

// Canada Post Helper
var CanadaPostHelper = function () {
    var self = this;
    this.createAuthorizedRequest = function (svc, profile, webRef, order, rmaNumber) {
        var isOrder = order instanceof require('dw/order/Order');
        var languageCode = Resource.msg('canadapost.languagecode', 'canadapost', 'en');
        var profileData = self.getServiceConfig(profile);
        var orderAddressMap = Site.getCurrent().getCustomPreferenceValue('returnFromAddress') && isOrder ? self.getReturnFromAddress() : self.getAddressMapFromOrder(order);
        var warehouseAddress = self.getWarehouseAddress();
        // Request
        var shipRequest = new webRef.CreateAuthorizedReturnRequest();

        shipRequest.setMailedBy(profileData.customer_id);
        shipRequest.setMobo(profileData.customer_id);
        shipRequest.setLocale(languageCode);

        var authorizedReturn = new webRef.AuthorizedReturnType();
        authorizedReturn.setServiceCode(profileData.serviceCode);
        var customerRef = new webRef.ReferencesType();
        customerRef.setCustomerRef1(rmaNumber);
        if (order.orderNo) {
            customerRef.setCustomerRef2(order.orderNo);
        }

        authorizedReturn.setReferences(customerRef);

        var returner = new webRef.ReturnerType();
        returner.setName(orderAddressMap.name);

        var domesticAddress = new webRef.DomesticAddressDetailsType();
        domesticAddress.setAddressLine1(orderAddressMap.address);
        if (('address2' in orderAddressMap) && !empty(orderAddressMap.address2)) {
            domesticAddress.setAddressLine2(orderAddressMap.address2);
        }
        domesticAddress.setCity(orderAddressMap.city);
        domesticAddress.setProvince(orderAddressMap.stateCode);
        domesticAddress.setPostalCode(orderAddressMap.postalCode.replace(/\s*/g, '').toUpperCase());

        returner.setDomesticAddress(domesticAddress);

        authorizedReturn.setReturner(returner);

        var receiver = new webRef.ReceiverType();
        receiver.setName(warehouseAddress.name);
        if (('email' in warehouseAddress) && !empty(warehouseAddress.email)) {
            receiver.setEmail(warehouseAddress.email);
        }
        if (('phone' in warehouseAddress) && !empty(warehouseAddress.phone)) {
            receiver.setReceiverVoiceNumber(warehouseAddress.phone);
        }

        domesticAddress = new webRef.DomesticAddressDetailsType();
        domesticAddress.setAddressLine1(warehouseAddress.address);
        if (('address2' in warehouseAddress) && !empty(warehouseAddress.address2)) {
            domesticAddress.setAddressLine2(warehouseAddress.address2);
        }
        domesticAddress.setCity(warehouseAddress.city);
        domesticAddress.setProvince(warehouseAddress.stateCode);
        domesticAddress.setPostalCode(warehouseAddress.postalCode.replace(/\s*/g, '').toUpperCase());

        receiver.setDomesticAddress(domesticAddress);

        authorizedReturn.setReceiver(receiver);
        shipRequest.setAuthorizedReturn(authorizedReturn);

        return shipRequest;
    };

    this.createGetArtifactRequest = function (svc, profile, webRef, artifactId) {
        // var profileData = self.getServiceConfig(profile);
        var languageCode = Resource.msg('canadapost.languagecode', 'canadapost', 'en');
        // Request

        var shipRequest = new webRef.GetArtifactRequest();
        shipRequest.setLocale(languageCode);
        shipRequest.setArtifactId(artifactId);

        return shipRequest;
    };

    this.parseAuthorizedResponse = function (svc, response) {
        if (empty(response)) {
            return null;
        }
        var authorizedReturnObj = {};
        if (response.getAuthorizedReturnInfoOrMessages() && 'artifacts' in response.getAuthorizedReturnInfoOrMessages()) {
            authorizedReturnObj = {
                status: 'OK',
                artifactId: response.getAuthorizedReturnInfoOrMessages() && response.getAuthorizedReturnInfoOrMessages().getArtifacts() && response.getAuthorizedReturnInfoOrMessages().getArtifacts().getArtifact()[0] && response.getAuthorizedReturnInfoOrMessages().getArtifacts().getArtifact()[0].getArtifactId(),
                trackingNumber: response.getAuthorizedReturnInfoOrMessages() && response.getAuthorizedReturnInfoOrMessages().getTrackingPin()
            };
        } else {
            authorizedReturnObj = {
                errorDescription: response.getAuthorizedReturnInfoOrMessages().message[0].description
            };
        }
        return authorizedReturnObj;
    };

    this.parseGetArtifactResponse = function (svc, response) {
        if (empty(response)) {
            return null;
        }

        return {
            status: 'OK',
            shipLabel: response.getArtifactDataOrMessages().getImage(),
            mimeType: response.getArtifactDataOrMessages().getMimeType()
        };
    };

    this.getMockedAuthorizedProcessResponse = function () {
        return {
            status: 'OK',
            artifactId: '10001135233',
            trackingNumber: '123456789012'
        };
    };
    /* eslint-disable spellcheck/spell-checker */
    this.getMockedGetArtifactProcessResponse = function () {
        return {
            status: 'OK',
            shipLabel: '',
            mimeType: 'application/pdf'
        };
    };
    /* eslint-enable spellcheck/spell-checker */
    this.getWarehouseAddress = function () {
        var warehouseAddress;
        try {
            warehouseAddress = JSON.parse(Site.getCurrent().getCustomPreferenceValue('returnAddress'));
        } catch (e) {
            Logger.error('CanadaPostHelper.js: Can not parse JSON config from Return Address from site preferences: ' + e.message);
        }
        return warehouseAddress || {};
    };

    this.getReturnFromAddress = function () {
        var returnFromAddress;
        try {
            returnFromAddress = JSON.parse(Site.getCurrent().getCustomPreferenceValue('returnFromAddress'));
        } catch (e) {
            Logger.error('CanadaPostHelper.js: Can not parse JSON config from Return From Address from site preferences: ' + e.message);
        }

        return returnFromAddress || {};
    };

    /**
     * Get service config
     * @param {profile} profile - ServiceProfile
     * @returns {Object} profile custom data
     */
    this.getServiceConfig = function (profile) {
        var data = {};
        try {
            data = JSON.parse(profile.custom.data);
        } catch (e) {
            Logger.error('CanadaPostHelper.js: Can not parse JSON config from Service: ' + e.message);
        }
        return data;
    };

    this.getAddressObject = function (formObj) {
        return {
            address1: formObj.address1.value,
            address2: formObj.address2.value,
            city: formObj.city.value,
            postalCode: formObj.zip.value,
            firstname: formObj.firstname.value,
            lastname: formObj.lastname.value,
            fullName: formObj.firstname.value + ' ' + formObj.lastname.value,
            phone: formObj.phone.value,
            email: formObj.email.value,
            stateCode: formObj.states.stateCA.value,
            orderNo: formObj.returnlabel.transactionId.value
        };
    };

    this.getAddressMapFromOrder = function (order) {
        var isOrder = order instanceof require('dw/order/Order');
        var addressData = order;
        if (isOrder) {
            addressData = order.defaultShipment;
        }
        var customerServicePhone = Site.getCurrent().getCustomPreferenceValue('customerServicePhone');
        return {
            name: addressData && addressData.shippingAddress ? addressData.shippingAddress.fullName : addressData.fullName,
            city: addressData && addressData.shippingAddress ? addressData.shippingAddress.city : addressData.city,
            postalCode: addressData && addressData.shippingAddress ? addressData.shippingAddress.postalCode : addressData.postalCode,
            stateCode: addressData && addressData.shippingAddress ? addressData.shippingAddress.stateCode : addressData.stateCode,
            address: addressData && addressData.shippingAddress ? addressData.shippingAddress.address1 : addressData.address1,
            address2: addressData && addressData.shippingAddress ? addressData.shippingAddress.address2 || '' : addressData.address2 || '',
            phone: addressData && addressData.shippingAddress ? addressData.shippingAddress.phone || customerServicePhone : addressData.phone
        };
    };
    this.setSecurityHeader = function (port, credential) {
        var username = credential.getUser();
        var password = credential.getPassword();
        var StringUtils = require('dw/util/StringUtils');
        // eslint-disable-next-line  no-undef
        var securityHeader = new XML(StringUtils.format('<wsse:Security xmlns:wsse="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd"><wsse:UsernameToken xmlns:wsse="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd"><wsse:Username>{0}</wsse:Username><wsse:Password xmlns:wsse="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd">{1}</wsse:Password></wsse:UsernameToken></wsse:Security>', username, password));
        require('dw/ws/WSUtil').addSOAPHeader(port, securityHeader, true, null);
    };
};

module.exports = CanadaPostHelper;
